import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

const NavigationBar = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Title = styled.span`
  font-size: 6rem;
`;

const NavBar = () => (
  <NavigationBar>
    <Title>Starhop</Title>
    <Link href="/About">
      <a>About</a>
    </Link>
  </NavigationBar>
);

export default NavBar;
